import React from 'react';
import Addtask from './Addtask';
import '.'


export default function Todo() {
  return (
    <>
    <div className="todo-container">
       <h1>Todo List</h1>
       <div className='add-task'></div>
      <Addtask/>
    </div>
    </>
  )
}
